  const [atomicNum, setatomicNum] = useState();
  setatomicNum(2);
  console.log(atomicNum);
  return( <div>
    <atomicContext.Provider value = {atomicNum}>
      <Header/>
      <DataBox/>
      <TableHolder/>
    </atomicContext.Provider>
  </div>
  )

};

export default App;
